import Client from './components/client';
import Produit from './components/Produit';
import Facture from './components/facture';
import Devis from './components/devis';

ReactDOM.render(
    <react>
        <TopBar>
        </TopBar>
    </react>,
    document.getElementById('root')
);
ReactDOM.render(
    <react>
        <LoginPage>
        </LoginPage>
    </react>,
    document.getElementById('root')
);
ReactDOM.render(
    <react>
        <Client>
        </Client>
    </react>,
    document.getElementById('root')
);
ReactDOM.render(
    <react>
        <Produit>
        </Produit>
    </react>,
    document.getElementById('root')
); 
ReactDOM.render(
    <react>
        <Facture>
        </Facture>
    </react>,
    document.getElementById('root')
); 
ReactDOM.render(
    <react>
        <Devis>
        </Devis>
    </react>,
    document.getElementById('root')
); 
ReactDOM.render(
    <react>
        <Rapport>
        </Rapport>
    </react>,
    document.getElementById('root')
);
